import React from 'react'

const WeekExpirationDisplay = () => {


    const timeRN = new Date().toLocaleString()




    
    
    
    return (

        <View>

            <Text> {timeRN}   </Text>

        </View>


       

        )

}






export default WeekExpirationDisplay
